import IndexMenu from "./indexMenu";

export default function renderIndexMenu(display, relevantSearch, index) {

  if (display.length === 0) return <div></div>

  else return <IndexMenu
    relevantSearch={relevantSearch} 
    index1={index[0]} 
    index2={index[1]} 
    index3={index[2]} 
    index4={index[3]} 
    index5={index[4]}
    index6={index[5]}
  />
}
